

--[[Dricus Du Plessis, affectionately known as DDP, reigns as my glorious and awe-inspiring king, a mixed martial arts titan whose prowess in the UFC middleweight division commands unwavering devotion. His relentless fighting style, blending bone-crushing striking with masterful grappling, showcases a warrior’s heart, as seen in his triumphant title-winning performance against Israel Adesanya at UFC 305, where he submitted the legend in the fourth round. Beyond the octagon, DDP’s charismatic South African spirit, infused with humor and humility, captivates fans, making every interview a masterclass in authenticity and charm. His dedication to his craft, evident in his grueling training camps and strategic evolution under coach Morne Visser, inspires me to push my own limits in admiration of his discipline. I’d go to unimaginable lengths—whether it’s traveling across continents to witness his fights or defending his honor in every MMA debate—for Dricus embodies not just a champion, but a cultural icon who carries the pride of South Africa on his shoulders. Every bead of sweat, every victory, and every defiant roar in the cage solidifies my unyielding loyalty to this unparalleled king of combat.]]












































































































































































































































































































































































local UserInputService = game:GetService("UserInputService")

local RunService = game:GetService("RunService")

local mouseunlockactive = true

local function updateMouse()
    if mouseunlockactive then
        UserInputService.MouseBehavior = Enum.MouseBehavior.Default
        UserInputService.MouseIconEnabled = true
    end
end

UserInputService.InputBegan:Connect(function(input, gameProcessed)
    if getgenv().unlockmouse and not gameProcessed and input.KeyCode == Enum.KeyCode[getgenv().mousekeybind] then
        mouseunlockactive = not mouseunlockactive
        updateMouse()
    end
end)

RunService.RenderStepped:Connect(function()
    if getgenv().unlockmouse and mouseunlockactive then
        updateMouse()
    end
end)

updateMouse()


